import React, { Fragment } from 'react';
import TrashClosedIcon from '../../../icons/trash-closed.svg';
import RoundButton from '../../UI/RoundButton';

const DeleteButton = () => {
    return (
        <Fragment>
            <img src={TrashClosedIcon} alt="Delete" />
        </Fragment>
    );
};

export default DeleteButton;
